(self.webpackChunk=self.webpackChunk||[]).push([[1287],{1287:function(a){a.exports='<p>在这里你可以找到 <strong>webpack</strong> 项目的品牌指南、资源和许可证。有关更多信息，请通过查看我们的官方<a href="https://github.com/webpack/media">媒资仓库</a>，并找到<a href="https://github.com/webpack/media/blob/master/LICENSE">许可证</a>来了解。点击任意图片下载它们。</p> <h2 id="the-name">名称 <a href="#the-name" aria-hidden="true" tabindex="-1"><span class="header-link"></span></a></h2> <p>webpack 应当__总是__以小写字母书写，即使在一句话的起始位置也是如此。</p> <h2 id="logo">Logo <a href="#logo" aria-hidden="true" tabindex="-1"><span class="header-link"></span></a></h2> <p>webpack logo 应放置在白色背景上，并且其周围有足够间距，如下所示:</p> <img src="https://raw.githubusercontent.com/webpack/media/master/logo/logo-on-white-bg.png" alt="webpack logo default with proper spacing on light background"/> <p><a href="https://github.com/webpack/media/blob/master/logo/logo-on-white-bg.svg">svg</a> | <a href="../github.com/webpack/media/blob/master/logo/logo-on-white-bg.png"/*tpa=https://github.com/webpack/media/blob/master/logo/logo-on-white-bg.png*/>png</a> | <a href="../github.com/webpack/media/blob/master/logo/logo-on-white-bg.jpg"/*tpa=https://github.com/webpack/media/blob/master/logo/logo-on-white-bg.jpg*/>jpg</a></p> <p>只需将内部深蓝色正方体的大小加倍，就可以知道 logo 应占据多大空间。</p> <p>对于深色背景，可以使用 logo 的反色版本：</p> <div style="display:block;background:#111"> <img src="https://raw.githubusercontent.com/webpack/media/master/logo/logo-on-dark-bg.png" alt="webpack logo default with proper spacing on light background"/> </div> <p><a href="https://github.com/webpack/media/blob/master/logo/logo-on-dark-bg.svg">svg</a> | <a href="../github.com/webpack/media/blob/master/logo/logo-on-dark-bg.png"/*tpa=https://github.com/webpack/media/blob/master/logo/logo-on-dark-bg.png*/>png</a> | <a href="../github.com/webpack/media/blob/master/logo/logo-on-dark-bg.jpg"/*tpa=https://github.com/webpack/media/blob/master/logo/logo-on-dark-bg.jpg*/>jpg</a></p> <blockquote class="tip"> <p>请尽可能的使用__图标 + 文本__的组合方式。</p> </blockquote> <h2 id="icon-only">只包含图标 <a href="#icon-only" aria-hidden="true" tabindex="-1"><span class="header-link"></span></a></h2> <p><strong>图标旨在用于布局有限的区域。如前所述，最好选择 图标+文字 的组合方式。</strong></p> <img src="https://raw.githubusercontent.com/webpack/media/master/logo/icon.png" width="250" alt="icon example"> <p><a href="https://github.com/webpack/media/blob/master/logo/icon.svg">svg</a> | <a href="../github.com/webpack/media/blob/master/logo/icon.png"/*tpa=https://github.com/webpack/media/blob/master/logo/icon.png*/>png</a> | <a href="../github.com/webpack/media/blob/master/logo/icon.jpg"/*tpa=https://github.com/webpack/media/blob/master/logo/icon.jpg*/>jpg</a></p> <p>适用于较大区域的正方形尺寸图标（例如头像或个人图片）：</p> <img src="https://raw.githubusercontent.com/webpack/media/master/logo/icon-square-big.png" width="250" alt="icon square big example"> <p><a href="https://github.com/webpack/media/blob/master/logo/icon-square-big.svg">svg</a> | <a href="../github.com/webpack/media/blob/master/logo/icon-square-big.png"/*tpa=https://github.com/webpack/media/blob/master/logo/icon-square-big.png*/>png</a> | <a href="../github.com/webpack/media/blob/master/logo/icon-square-big.jpg"/*tpa=https://github.com/webpack/media/blob/master/logo/icon-square-big.jpg*/>jpg</a></p> <p>适用于较小区域的正方形尺寸图标（例如，favicon）：</p> <img src="https://raw.githubusercontent.com/webpack/media/master/logo/icon-square-small.png" width="50" alt="icon square small example"> <p><a href="https://github.com/webpack/media/blob/master/logo/icon-square-small.svg">svg</a> | <a href="../github.com/webpack/media/blob/master/logo/icon-square-small.png"/*tpa=https://github.com/webpack/media/blob/master/logo/icon-square-small.png*/>png</a> | <a href="../github.com/webpack/media/blob/master/logo/icon-square-small.jpg"/*tpa=https://github.com/webpack/media/blob/master/logo/icon-square-small.jpg*/>jpg</a></p> <blockquote class="tip"> <p>对于那些遵循我们的指南，并已经深入了解的人，我们还制作了一个专门用于自定义 emoji 符号的特殊小尺寸图片（例如，在 slack 或 gitter 频道 ;)）。</p> </blockquote> <img src="assets/icon-square-small-slack.png"/*tpa=https://webpack.docschina.org/assets/icon-square-small-slack.png*/ width="50" alt="icon square small example"> <h2 id="front">字体 <a href="#front" aria-hidden="true" tabindex="-1"><span class="header-link"></span></a></h2> <p>我们使用由一群极具天赋的人所设计的 <a href="http://atipofoundry.com/">Atipo Foundry</a> 这款漂亮字体，它来自 <a href="http://atipofoundry.com/fonts/geomanist">Geomanist Medium</a> 这个网站，并通过“随你付”的模式来提供完整的字体族。</p> <h2 id="color-palette">调色板 <a href="#color-palette" aria-hidden="true" tabindex="-1"><span class="header-link"></span></a></h2> <p>在 <a href="https://opencollective.com/">Open Collective</a> 和 <a href="https://medium.com/u/840563ee2a56">Threadless</a> 的帮助下，以下颜色在我们整个网站中被以各种组合形式使用，并且在 <a href="https://webpack.threadless.com/collections/the-final-release-collection/">webpack 官方商城</a> 推出的时尚服装系列中也用了这些颜色！</p> <table> <thead> <tr> <th>颜色名称</th> <th>HEX 码</th> <th>RGB 码</th> <th>示例</th> </tr> </thead> <tbody> <tr> <td data-th="颜色名称"><span>Malibu:</span></td> <td data-th="HEX 码"><span>HEX <code>#8dd6f9</code></span></td> <td data-th="RGB 码"><span><code>rgb: 141, 214, 249</code></span></td> <td data-th="示例"><span><div style="background-color:#8dd6f9"> </div></span></td> </tr> <tr> <td data-th="颜色名称"><span>Denim:</span></td> <td data-th="HEX 码"><span>HEX <code>#1d78c1</code></span></td> <td data-th="RGB 码"><span><code>rgb: 29, 120, 193</code></span></td> <td data-th="示例"><span><div style="background-color:#1d78c1"> </div></span></td> </tr> <tr> <td data-th="颜色名称"><span>Fiord:</span></td> <td data-th="HEX 码"><span>HEX <code>#465E69</code></span></td> <td data-th="RGB 码"><span><code>rgb: 70, 94, 105</code></span></td> <td data-th="示例"><span><div style="background-color:#465e69"> </div></span></td> </tr> <tr> <td data-th="颜色名称"><span>Outer Space:</span></td> <td data-th="HEX 码"><span>HEX <code>#2B3A42</code></span></td> <td data-th="RGB 码"><span><code>rgb: 43, 58, 66</code></span></td> <td data-th="示例"><span><div style="background-color:#2b3a42"> </div></span></td> </tr> <tr> <td data-th="颜色名称"><span>White:</span></td> <td data-th="HEX 码"><span>HEX <code>#ffffff</code></span></td> <td data-th="RGB 码"><span><code>rgb: 255, 255, 255</code></span></td> <td data-th="示例"><span><div style="background-color:#fff"> </div></span></td> </tr> <tr> <td data-th="颜色名称"><span>Concrete:</span></td> <td data-th="HEX 码"><span>HEX <code>#f2f2f2</code></span></td> <td data-th="RGB 码"><span><code>rgb: 242, 242, 242</code></span></td> <td data-th="示例"><span><div style="background-color:#f2f2f2"> </div></span></td> </tr> <tr> <td data-th="颜色名称"><span>Alto:</span></td> <td data-th="HEX 码"><span>HEX <code>#dedede</code></span></td> <td data-th="RGB 码"><span><code>rgb: 222, 222, 222</code></span></td> <td data-th="示例"><span><div style="background-color:#dedede"> </div></span></td> </tr> <tr> <td data-th="颜色名称"><span>Dusty Gray:</span></td> <td data-th="HEX 码"><span>HEX <code>#999999</code></span></td> <td data-th="RGB 码"><span><code>rgb: 153, 153, 153</code></span></td> <td data-th="示例"><span><div style="background-color:#999"> </div></span></td> </tr> <tr> <td data-th="颜色名称"><span>Dove Gray:</span></td> <td data-th="HEX 码"><span>HEX <code>#666666</code></span></td> <td data-th="RGB 码"><span><code>rgb: 102, 102, 102</code></span></td> <td data-th="示例"><span><div style="background-color:#666"> </div></span></td> </tr> <tr> <td data-th="颜色名称"><span>Emperor:</span></td> <td data-th="HEX 码"><span>HEX <code>#535353</code></span></td> <td data-th="RGB 码"><span><code>rgb: 83, 83, 83</code></span></td> <td data-th="示例"><span><div style="background-color:#535353"> </div></span></td> </tr> <tr> <td data-th="颜色名称"><span>Mine Shaft:</span></td> <td data-th="HEX 码"><span>HEX <code>#333333</code></span></td> <td data-th="RGB 码"><span><code>rgb: 51, 51, 51</code></span></td> <td data-th="示例"><span><div style="background-color:#333"> </div></span></td> </tr> </tbody> </table> <p>此外，你可以直接从下面的链接，获取这些类型的文件：</p> <p><a href="https://raw.githubusercontent.com/webpack/media/master/design/webpack-palette.psd">psd</a> | <a href="../raw.githubusercontent.com/webpack/media/master/design/webpack-palette.png"/*tpa=https://raw.githubusercontent.com/webpack/media/master/design/webpack-palette.png*/>png</a> | <a href="https://raw.githubusercontent.com/webpack/media/master/design/webpack-palette.ai">ai</a> | <a href="https://raw.githubusercontent.com/webpack/media/master/design/webpack-palette.svg">svg</a></p> <h2 id="license">许可证 <a href="#license" aria-hidden="true" tabindex="-1"><span class="header-link"></span></a></h2> <p>logo 和品牌名称__并不遵循 MIT 许可__。请查看我们的<a href="https://github.com/webpack/media/blob/master/LICENSE">许可证</a>页面，以获取使用指南。</p> '}}]);